member.summary:
 从云端下载文件,下载是在一个独立的线程中进行的，返回的结果rsp.success=true,不表示文件下载成功
 要想知道文件是否下载成功，请定义需要定义一个线程结束的处理函数
  public void DloadFileWork_ProgressChanged(object sender, System.ComponentModel.ProgressChangedEventArgs e)
 {
    var para = e.UserState as object[];
    string msg = (string)para[0];//提示信息：如文件下载 56%，文件下载失败等信息
    string url = (string)para[1];//文件下载地址
    progressBar1.Value = e.ProgressPercentage;//界面上显示进度条
    lbl_downloadStatus.Text = msg;//界面上显示下载状态信息

 }
 public void DloadFileWork_RunWorkerCompleted(object sender, System.ComponentModel.RunWorkerCompletedEventArgs e)
{
   bool result = (bool)e.Result;
   if (result == true)//下载成功
       MessageBox.Show("download file successfully!");
   else//下载失败
       MessageBox.Show("download file fail!");
}

指定文件下载进度更新显示的处理，需要按照下面的格式定义一个函数，并将文件名赋值为workComplete
private static void DloadFileWork_ProgressChanged(object sender, System.ComponentModel.ProgressChangedEventArgs e)
{
}

指定文件下载结束后的处理函数，需要按照下面的格式定义一个函数，并将文件名赋值为workComplete
private static void DloadFileWork_RunWorkerCompleted(object sender, System.ComponentModel.RunWorkerCompletedEventArgs e)
{  
}
